import React, { Component } from 'react';
import logo from '../assets/logo.svg';
import '../css/App.css';
import Person from './Person';

class App extends Component {
  state={test: 'test'}

  render() {
    return (
      <div className="App">
        <h1>Hi, I am not React dev.</h1>
        <Person />
        <Person name = 'testies'/>
        <Person name = 'timmy'>TIMMMAAAAAY</Person>
      </div>
    );
  }
}

export default App;
